  \"2015-09-26T19:35:30.578062\",\n\t\"name\": \"environmental-sensitivity-index-esi-atlas-alabama-maps-and-geographic-information-systems-data-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps for the shoreline of Alabama. ESI data characterize
  coastal environments and wildlife by their sensitivity to spilled oil. The ESI data
  include information for three main components: shoreline habitats; sensitive biological
  resources; and human-use resources. This atlas was developed to be utilized within
  desktop GIS systems and contains GIS files and related D-base files. Associated
  files include MOSS (Multiple Overlay Statistical System) export files, .PDF maps,
  and detailed user guides and metadata.nnThe intertidal habitats were mapped using
  a combination of aerial photographs taken between 1985 and 1987, and low altitude
  color video surveys taken in 1992 and 1993. The biological and human-use resources
  data were compiled by regional biologists in 1995. The dates for these source data
  vary and range from the mid- 1970s to the mid-1990s. Detailed date information is
  provided in the included metadata.\",\n\t\"license_title\": null,\n\t\"extras\":
